import React from "react";

const Table=({data, column}) => {
  return (
    <>
      <table>
        <thead>
          <tr>
            {column.map((item) => <TableHeadItem item={item}/>)}
          </tr>
        </thead>
        <tbody>
          {data.map((item) => <TableRow item={item}/>)}
        </tbody>
      </table>
    </>
  );
}

const TableHeadItem = ({ item }) => <th>{item.heading}</th>
const TableRow = ({ item }) => {
  console.log(item)
}
export default Table;
